import React from "react";

const About = () => {
  return (
    <div className="section">
      <h2>About Me</h2>
      <p>I am Shreya Shastry, a third year B.Tech student studying at VIT University, Vellore. Driven by a thirst of knowledge and innovation, I am enthusiastic about applying my skills to real-world challenges. 
  My goal is to become a proficient technologist and make impactful contributions to the ever-evolving field of information technology.
 </p>

    </div>
  );
};

export default About;
